import './index.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from "./components/Navbar";
import Secondimg from './components/Secondimg';
import Grounds from './components/Grounds';


function App() {
  return (
    <Router>
    <div className="App">
      <Navbar />
      <Switch>
        <Route exact path="/" component={Secondimg} />
        <Route exact path="/grounds" component={Grounds} />
        {/* Other routes if any */}
      </Switch>
    </div>
  </Router>
);
}
  export default App
